window.bookSummaryJSON = "<p>Lily has always lived up to her preacher father’s expectations of how she should behave, but all that changes when a hot stranger walks in to her hair salon and a feral need to have him takes over her common sense. On a whim, she screws him in the supply room, caving to a desire that only grows with each kiss.</p> <p>When she learns he’s the billionaire alpha who wants to boot her out of her business for the sake of his own, she’s livid. But the pulse between her legs never got the memo. Things heat up even more when he offers her a naughty proposal that’s going to make this good girl stop thinking twice about being bad…</p>"; 
